import React from "react";
import { create } from '@react-navigation/native-stack';
import Index from "../screens/Index"

const Stack = createNavigator();

export default function IndexStack(){
    return(
        <Stack.Navigator>
            <Stack.Screen 
                name="index"
                component={Index}
            />
        </Stack.Navigator>
    )
}
